import React from 'react';

interface InnerWrapper {
    lines: string[];

    keyPropagation: string;
}

export class BLog extends React.Component< InnerWrapper, {}> {
    render() {
        return (
            <div key={ this.props.keyPropagation }>
                { this.props.lines.map((value: string, _: number) => {
                   return <p> { value } </p>
                })}
            </div>
        )
    }
}
